import React, { useState } from "react";
import Popup from "./components/Popup";

function App() {
  const [showPopup, setShowPopup] = useState(true);

  const handleRegister = (credentials) => {
    console.log("User registered:", credentials);
    setShowPopup(false);
  };

  const handleClose = () => {
    setShowPopup(false);
  };

  return (
    <div className="App">
      {showPopup && <Popup onRegister={handleRegister} onClose={handleClose} />}
      <h1>Welcome to CoDikty</h1>
      {/* محتوى المنصة */}
    </div>
  );
}

export default App;
